import React from 'react';
import { Typography } from '@material-ui/core';

const HomeMain = () => {
    return (
        <div>
            <Typography variant="h1" component="h2" gutterBottom>
                h1. Heading
            </Typography>
        </div>
    )
}

export default HomeMain;
